I have an array of strings that I want to sort case-sensitively. I tried using the sort() method, but it seems to sort case-insensitively by default. For example:
const arr = ['apple', 'Banana', 'kiwi', 'Avocado'];
arr.sort();
console.log(arr);
// Output: ["apple", "Avocado", "Banana", "kiwi"]
As you can see, the sorting is case-insensitive, with "Avocado" coming before "Banana" even though "B" comes before "A" in the ASCII table.
Is there a way to sort the array case-sensitively, so that the output would be ["apple", "Banana", "kiwi", "Avocado"] ? I want the sorting to respect the ASCII order, with uppercase letters coming before lowercase letters.
You can provide a custom comparison function to the sort() method to achieve case-sensitive sorting. Here's an example:
const arr = ['apple', 'Banana', 'kiwi', 'Avocado'];
arr.sort((a, b) => a.localeCompare(b, undefined, { sensitivity: 'case' }));
console.log(arr);
// Output: ["apple", "Banana", "kiwi", "Avocado"]
